import React from 'react';
import { Switch, Route, Redirect } from 'react-router-dom';
import './App.css';

//Maybe be deleted
import { ProtectedRoute } from './Components/ProtectedRoute/ProtectedRoute.component.jsx';
import auth from './auth';

//Pages
import ImagesPage from './Pages/ImagesPage/ImagesPage.component.jsx';
import SignIn from './Pages/Authentication/SignIn/Signin.component.jsx';
import SignUp from './Pages/Authentication/SignUp/Signup.component.jsx';

//Material UI
import { createMuiTheme } from '@material-ui/core/styles';
import { ThemeProvider } from '@material-ui/styles';

function App() {
  const theme = createMuiTheme({
    palette: {
      primary: {
        main: '#3DB46D',
        contrastText: '#fff',
      },
      secondary: {
        main: '#EB5757',
        contrastText: '#fff',
      },
    },
  });

  return (
    <ThemeProvider theme={theme}>
      <div className="App">
        <Switch>
          <Route
            exact
            path="/"
            render={() =>
              auth.isAuthenticated() ? <Redirect to="/images" /> : <SignIn />
            }
          ></Route>
          <Route
            exact
            path="/signup"
            render={() =>
              auth.isAuthenticated() ? <Redirect to="/images" /> : <Sign />
            }
          ></Route>
          <ProtectedRoute
            exact
            path="/images"
            component={ImagesPage}
          ></ProtectedRoute>
          <Route path="*" component={() => <h1>404 NOT FOUND</h1>} />
        </Switch>
      </div>
    </ThemeProvider>
  );
}

export default App;
